import React from 'react';
import { connect } from 'redux-bundler-react';
import {
  Map,
  addData,
  basemapSwitcher,
  bookmarks,
  coordDisplay,
  draw,
  geocoder,
  identify,
  measureTools,
  rotateNorth,
  themeSwitcher,
  treeView,
  zoomInOut,
  zoomHome,
  zoomToBox
} from "@corpsmap/corpsmap";
import "@corpsmap/corpsmap/css/corpsmap.css";

import cm2Plugin from "../../plugins/cm2-layers";

class MapPage extends React.Component {
  render(){
    return (
      <div className="container">
        <div className="card bg-light m-5">
          <div className="card-body">
            <h2>Welcome to @corpsmap</h2>
            <Map
              height={500}
              theme="blue"
              plugins={[
                addData,
                basemapSwitcher,
                bookmarks,
                coordDisplay,
                draw,
                geocoder,
                identify,
                measureTools,
                rotateNorth,
                themeSwitcher,
                treeView,
                zoomInOut,
                zoomHome,
                zoomToBox,
                cm2Plugin
              ]}
            />
          </div>
        </div>
      </div>
    )
  }
}
export default connect(
  MapPage
  );
